import React, {Component} from 'react'
import Head from 'next/head'
// import TopLayover from '../components/TopLayover/TopLayover'
import Navbar from '../components/Navbar/Navbar'
import Menu from '../components/MenuContainer/MenuContainer'
import NotFound from '../containers/NotFound/NotFound'
import {resize} from '../utils/common/common'
import {PageDataContext} from '../utils/context/pageContext'



class Home extends Component {

  componentDidMount(){
    // resize event to when the browser is resized
    // resize()
    // window.addEventListener('resize', resize)
  }

  render(){
    let pageData = this.props.pageData

    return (
      <div className="container">
        <Head>
          <title>Aiman Adlawan | Page not found</title>
          <link rel="icon" href="/images/images/brand-icon-logo.ico" />
        </Head>

        <div className="container">
          {/* <TopLayover/> */}
          <div className="main-container">
            <PageDataContext pagesets={'notfound'}>
              <Navbar />       
              <Menu />
              <main className='main'>
                <NotFound />
              </main>
            </PageDataContext>
          </div>
        </div>
      </div>
    )
  }
}

export default Home
